INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "青空の下で謁見", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 0, 8, "フリーマーケット会場", 2834, 2, 10118, 1, 7, 20063115, "ペコリーヌとの出会い", 40, 5118061);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "未来の騎空団\nマスコット？", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 0, 8, "フリーマーケット会場", 2835, 2, 10118, 1, 7, 20063115, "マホとの出会い", 40, 5118062);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "お嬢さまからの\n緊急依頼", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 0, 8, "ランドソル市街地", 2837, 2, 10118, 1, 7, 20063115, "アキノとの出会い", 40, 5118063);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "黄金色の悩みごと", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 0, 8, "フリーマーケット会場", 4108402, 2, 10118, 1, 18, 20063115, "ジュンとの出会い", 40, 5118064);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "白熱！　格闘大会！", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 0, 8, "フリーマーケット会場", 4107402, 2, 10118, 1, 18, 20063115, "カオリとの出会い", 40, 5118065);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "祭り太鼓はオーエドの華", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 1, 8, "オーエド町", 9000227, 2, 10118, 1, 16, 20063115, "ニノンとの出会い", 40, 5118066);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "人気者は遅れて\nやってくる", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 0, 8, "フリーマーケット会場", 2101181, 3, 10118, 1, 19, 20063115, "スズナとの出会い", 40, 5118067);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "巫女・ミーツ・魔法少女", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 0, 8, "ランドソル市街地", 4109402, 3, 10118, 1, 18, 20063115, "ナナカとの出会い", 40, 5118068);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "ネズ耳は二度なくなる", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 0, 8, "フリーマーケット会場", 4305402, 3, 10118, 1, 18, 20063115, "キャル＆コッコロとの出会い", 40, 5118069);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "この出会いにカンパイ！", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 0, 8, "ランドソル市街地", 4101402, 3, 10118, 1, 18, 20063115, "ユカリとの出会い", 40, 5118070);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "陰陽アンサンブル", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 0, 8, "ランドソル市街地", 4106402, 3, 10118, 1, 18, 20063115, "アオイとの出会い", 40, 5118071);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "運試し十番勝負！", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 1, 8, "フリーマーケット会場", 2836, 3, 10118, 1, 7, 20063115, "シノブとの出会い", 40, 5118072);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (0, "彼女たちの新たな日常", 0, 0, 0, 0, 0, 1, 10118, 0, 0, 20063115, "オープニング", 0, 5118600);
